import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {  faPhoneAlt } from '@fortawesome/free-solid-svg-icons';
import { faFacebook } from '@fortawesome/free-brands-svg-icons';
import { faWhatsapp } from '@fortawesome/free-brands-svg-icons';
import contact from "../contact/contact.css";



function Contact() {
  return (
    <div className='cntimg'>
        <div>
        <a href="https://wa.me/1234567890" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faWhatsapp} size="2x" color="green" />
        </a>
      </div>
      <div>
        <a href="tel:+1234567890" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faPhoneAlt} size="2x" color="blue" />
        </a>
      </div>
      <div>
        <a href="https://facebook.com/yourpage" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faFacebook} size="2x" color="blue" />
        </a>
      </div>
    </div>
  )
}

export default Contact
